import React from 'react';
import 'antd/dist/antd.css';
import { Form, Input, Button, Checkbox, Space} from 'antd';


export default class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      value: null,
    };
  }

   layout = {
    labelCol: {
      span: 8,
    },
    wrapperCol: {
      span: 16,
    },
  };
   tailLayout = {
    wrapperCol: {
      offset: 8,
      span: 16,
    },
  };

  onFinish = (values) => {
    console.log('Success:');
  };

  onClick = () => {
    console.log('EIEI:');
  };

  onFinishFailed = (errorInfo) => {
    console.log('Failed:');
  };

  render() {
    return (
      <div style={{display:'flex',  justifyContent:'center', alignItems:'center' , backgroundColor:'red',height:'100vh'}}>
        <Form  name="basic" initialValues={{remember: true,}}>
        <Form.Item label="Username" name="username" rules={[{required: true,message: 'Please input your username!'}]}>
          <Input />
        </Form.Item>

        <Form.Item label="Password" name="password" rules={[{required: true,message: 'Please input your password!',},]}>
          <Input.Password />
        </Form.Item>

        <Form.Item style={{textAlign: 'center',}} name="remember" valuePropName="checked">
          <Checkbox>Remember me</Checkbox>
        </Form.Item>
        <Space style={{}}>
          <Form.Item style={{textAlign: 'center',flexDirection:'row'}}>
          <Button type="primary" onClick={this.onClick}>
            Submit
          </Button>
          <Button type="primary" onClick={this.onClick}>
            Reset
          </Button>
        </Form.Item>
        </Space>
      </Form>
    </div>
    );
  }
}
